			<description><![CDATA[<div align="center"><a href="https://www.criativo7.com.br/" target="_blank"><img alt="" border="0" src="https://www.criativo7.com.br/img/logo-criativo7.png"/></a></div>
Fala galera.<br />
<br />
<b>O que й?</b><br />
Script de site em HTML5 &amp; CSS3 + PSD do banner do topo + sistema de ranking sem uso de MySQL desenvolvido em bootstrap.<br />
<br />
<b>Intro</b><br />
<br />
Resolvi publicar estes arquivos depois de ter postado um GM na board e uma pessoa me perguntou por quanto eu venderia ele, porйm nгo criei-o no objetivo de vender, entгo estou por aqui para estar disponibilizando para vocкs de forma gratuita este script em HTML5 e CSS3 desenvolvido com bootstrap para vocк quem desejar criar um site para seu servidor. Criei ele baseado utilizando o bootstrap, sendo assim, ele se adйqua perfeitamente em smartphones e tablets.<br />
<br />
Nele acompanha um sistema de ranking online, como foi feito para um servidor de DM, ao player deslogar do servidor ele envia as informaзхes para o PHP atravйs do GET_POST sem que seja preciso utilizar MySQL.<br />
<br />
<b>Como usar o sistema de ranking?</b><br />
<br />
Se vocкs optarem por nгo utilizar este sistema de ranking online, basta apenas excluir o arquivo PHP por nome <b>ranking.php</b> e usar apenas o site em HTML5 e CSS3.<br />
<br />
Para fazer uso do sistema:<br />
<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">pawn Code:</div>
<pre class="alt2" style="margin:0px; padding:6px; border: 1px solid #C2C2C2; width:800px; height:295px; overflow:auto"><div dir="ltr" style="text-align:left;"><div class="pawn" style="font-family:monospace;"><span style="color: #228822;">// adicione esta include no topo do seu GM</span><br/><span style="color: #2222AA;">#include a_http</span><br/><br/><span style="color: #228822;">// adicione no seu OnPlayerDisconnect a seguinte funзгo:</span><br/>SendPlayerInfo<span style="color: #000000;">(</span>playerid<span style="color: #000000;">)</span>;<br/><br/><span style="color: #228822;">// no final do GM</span><br/><span style="color: #2222BB;">stock</span> SendPlayerInfo<span style="color: #000000;">(</span>playerid<span style="color: #000000;">)</span><br/><span style="color: #000000;">{</span><br/>    <span style="color: #2222BB;">static</span> _string<span style="color: #000000;">[</span><span style="color: #000000;">128</span><span style="color: #000000;">]</span>, nome<span style="color: #000000;">[</span><span style="color: #000000;">24</span><span style="color: #000000;">]</span>;<br/><br/>    GetPlayerName<span style="color: #000000;">(</span>playerid, nome, <span style="color: #000000;">24</span><span style="color: #000000;">)</span>;<br/>    <span style="color: #222222;">format</span><span style="color: #000000;">(</span>_string, <span style="color: #2222BB;">sizeof</span> _string, HOST_URL <span style="color: #000066;">"?test=%s,%d,%d"</span>, nome, Player<span style="color: #000000;">[</span>playerid<span style="color: #000000;">]</span><span style="color: #000000;">[</span>Matou<span style="color: #000000;">]</span>, Player<span style="color: #000000;">[</span>playerid<span style="color: #000000;">]</span><span style="color: #000000;">[</span>Morreu<span style="color: #000000;">]</span><span style="color: #000000;">)</span>;<br/>    HTTP<span style="color: #000000;">(</span>playerid, HTTP_POST, _string, <span style="color: #2222AA;">#, "MyHttpResponse");</span><br/>    <span style="color: #2222BB;">return</span> <span style="color: #000000;">1</span>;<br/><span style="color: #000000;">}</span><br/><span style="color: #228822;">// aqui ele vai estar pegando informaзхes de quantos players o jogador matou e morreu</span></div></div></pre>
</div>
O uso do sistema de ranking й muito simples, e <b>FOI DESENVOLVIDO POR: GARFIELD (daqui do fуrum)</b><br />
<br />
