			<title><![CDATA[[Tutorial] Aumentar ou diminuir vida do jogador.]]></title>
			<link>https://sampforum.blast.hk/showthread.php?tid=676499</link>
			<pubDate>Thu, 11 Jun 2020 00:43:00 +0000</pubDate>
			<dc:creator><![CDATA[<a href="https://sampforum.blast.hk/member.php?action=profile&uid=344971">RodrigoAraujo</a>]]></dc:creator>
			<guid isPermaLink="false">https://sampforum.blast.hk/showthread.php?tid=676499</guid>
			<description><![CDATA[Sei que muitos irгo dizer e pensar, que esse meu tutorial й uma coisa besta, ou que todo mundo ja sabe, mas descobri que muitos ainda tem estas duvidas, por isso fiz este tutorial!<br />
<br />
Em seu comando faзa o seguinte:<br />
<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">Code:</div>
<pre class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 130px;
		text-align: left;
		overflow: auto">CMD:ganharvida(playerid)
{
       new Float:vida; <font color="YellowGreen">//Criaremos uma variavel de Vida.</font>
       GetPlayerHealth(playerid, vida); <font color="YellowGreen">//Iremos getar a vida do jogador, com a variavel criada acima.</font>
       SetPlayerHealth(playerid, (vida+10)); <font color="YellowGreen">//Irб aumentar a vida do jogador, de acordo com a vida dele (irб aumentar para 10).</font>
       return 1;
}</pre>
</div>Jб o para diminuir a vida, ultilize os mesmo parвmetros acima, apenas, modifique de "(vida+10)" para "(vida-10)"!<br />
<br />
<br />
Quaisquer critica, serб bem-vinda.]]></description>
