			<description><![CDATA[<font size="5">Adicione Elevadores</font><br />
Hб muito tempo nгo posto um lanзamento, mas, nos tempos livres... hб algumas coisas que vem em mente. <br />
<br />
Basicamente, esta include adicione elevadores ao jogo.<br />
<b>- Mas Locky, nгo hб o FS do <i>ls_beachside</i>, <i>ls_apartments1</i>, <i>ls_elevator </i>original do SA-MP?</b><br />
Sim, hб eles, em inglкs, mas vocк caso queira realizar ediзхes... bem, й bem trabalhoso, e se vocк criar um prйdio que pode colocar elevador e tenha que configurar tudo, alйm disso, vocк terб que utilizar scripts (filterscripts) diferentes para manipular cada elevador.<br />
<br />
Minha maior dificuldade (por incrнvel que pareзa) foi acertar os cбlculos matemбticos para mover as portas. Quando vocк cria um script para uma ъnica tarefa (<i>ls_beachside </i>por exemplo) vocк pega a coordenada da porta aberta, e dela fechada (tanto X ou Y). A facilidade deste, й que й sу vocк criar o elevador em determinada posiзгo. O prуprio script irб calcular as coordenadas para abrir.<br />
<br />
<b>Requisitos</b><ul><li>SA-MP Server (avб)</li>
<li>Plugin streamer (para vocк criar diversos, se quiser, em interior e mundos diferentes)</li>
</ul>
<i>Agradecimentos especiais a Zamaroht (a base criada para os elevadores originalmente), Kye (barulhinho do som), e Matite (objetos novos do SA-MP 0.3.7) </i><br />
<br />
<b>Funзхes</b><br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">pawn Code:</div>
<pre class="alt2" style="margin:0px; padding:6px; border: 1px solid #C2C2C2; width:800px; height:279px; overflow:auto"><div dir="ltr" style="text-align:left;"><div class="pawn" style="font-family:monospace;"><span style="color: #2222BB;">native</span> AddElevator<span style="color: #000000;">(</span><span style="color: #000000;">Float</span><span style="color: #000000;">:</span>posx, <span style="color: #000000;">Float</span><span style="color: #000000;">:</span>posy, <span style="color: #000000;">Float</span><span style="color: #000000;">:</span>posz, <span style="color: #000000;">Float</span><span style="color: #000000;">:</span>ang, ElevatorName<span style="color: #000000;">[</span><span style="color: #000000;">]</span> <span style="color: #000000;">=</span> <span style="color: #000066;">""</span>, Interior <span style="color: #000000;">=</span> <span style="color: #000000;">-</span><span style="color: #000000;">1</span>, VirtualWorld <span style="color: #000000;">=</span> <span style="color: #000000;">-</span><span style="color: #000000;">1</span><span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">native</span> IsValidElevator<span style="color: #000000;">(</span>elevatorid<span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">native</span> DestroyElevator<span style="color: #000000;">(</span>elevatorid<span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">native</span> GetElevatorName<span style="color: #000000;">(</span>elevatorid, <span style="color: #000000;">&amp;</span>ElevatorName<span style="color: #000000;">[</span><span style="color: #000000;">]</span>, <span style="color: #000000;">&amp;</span>size<span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">native</span> GetElevatorPos<span style="color: #000000;">(</span>elevatorid, <span style="color: #000000;">Float</span><span style="color: #000000;">:</span>x, <span style="color: #000000;">Float</span><span style="color: #000000;">:</span>y, <span style="color: #000000;">Float</span><span style="color: #000000;">:</span>z<span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">native</span> GetElevatorOnFloor<span style="color: #000000;">(</span>elevatorid<span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">native</span> AddFloorToElevator<span style="color: #000000;">(</span>elevatorid, <span style="color: #000000;">Float</span><span style="color: #000000;">:</span>fz, floorname<span style="color: #000000;">[</span><span style="color: #000000;">]</span>, <span style="color: #000000;">bool</span><span style="color: #000000;">:</span>IsOpen <span style="color: #000000;">=</span> false<span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">native</span> CallElevatorToFloor<span style="color: #000000;">(</span>elevatorid, floorid<span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">native</span> OpenPortsElevator<span style="color: #000000;">(</span>elevatorid<span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">native</span> ClosePortsElevator<span style="color: #000000;">(</span>elevatorid<span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">native</span> SelectFloorOnElevator<span style="color: #000000;">(</span>elevatorid, floorid<span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">native</span> GetMaxFloorElevator<span style="color: #000000;">(</span>elevatorid<span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">native</span> GetFloorNameForElevator<span style="color: #000000;">(</span>floorid, elevatorid, <span style="color: #000000;">&amp;</span>floorname<span style="color: #000000;">[</span><span style="color: #000000;">]</span>, <span style="color: #000000;">&amp;</span>size<span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">native</span> IsPlayerInElevator<span style="color: #000000;">(</span>playerid, elevatorid<span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">native</span> GetPlayerFrontElevator<span style="color: #000000;">(</span>playerid, elevatorid<span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">native</span> GetElevatorPoolSize<span style="color: #000000;">(</span><span style="color: #000000;">)</span>;</div></div></pre>
</div>
<b>Explicando as funзхes</b><ul><li>AddElevator - Criar (ou adicionar) um elevador (avб)</li>
<li>IsValidElevator - Verificar se o elevador й vбlido</li>
<li>DestroyElevator - Destruir elevador</li>
<li>GetElevatorName - Obter o nome de um elevador</li>
<li>GetElevatorPos - Obter a posiзгo de um elevador</li>
<li>GetElevatorOnFloor - Obter o andar de um elevador</li>
<li>GetElevatorPoolSize - Obtem o mбximo de elevadores do jogo</li>
<li>AddFloorToElevator - Adicionar um andar ao elevador</li>
<li>CallElevatorToFloor - Chamar o elevador (utilizando muito internamente)</li>
<li>SelectFloorOnElevator - Selecionar o elevador (praticamente o mesmo uso da funзгo acima)</li>
<li>OpenPortsElevator - Abrir portas do elevador (nгo й preciso chama-la)</li>
<li>ClosePortsElevator - Fechar portas do elevador (nгo й preciso chama-la)</li>
<li>GetMaxFloorElevator - Obtem o mбximo de andares disponнveis por elevador</li>
<li>GetFloorNameForElevator - Obtem o nome do andar</li>
<li>IsPlayerInElevator - Verifica se o jogador estб em um elevador</li>
<li>GetPlayerFrontElevator - Obtem o id do elevador que estб bem na frente do jogador</li>
</ul>
<b>Callbacks</b><br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">pawn Code:</div>
<pre class="alt2" style="margin:0px; padding:6px; border: 1px solid #C2C2C2; width:800px; height:119px; overflow:auto"><div dir="ltr" style="text-align:left;"><div class="pawn" style="font-family:monospace;"><span style="color: #2222BB;">forward</span> OnElevatorCalled<span style="color: #000000;">(</span>elevatorid, floorid<span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">forward</span> OnElevatorStoped<span style="color: #000000;">(</span>elevatorid<span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">forward</span> OnPlayerEnterElevator<span style="color: #000000;">(</span>playerid, elevatorid<span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">forward</span> OnPlayerIsFrontElevator<span style="color: #000000;">(</span>playerid, elevatorid, floor<span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">forward</span> OnPlayerLeaveElevator<span style="color: #000000;">(</span>playerid, elevatorid<span style="color: #000000;">)</span>;<br/><span style="color: #2222BB;">forward</span> OnPlayerLeaveFrontElevator<span style="color: #000000;">(</span>playerid, elevatorid, floor<span style="color: #000000;">)</span>;</div></div></pre>
</div><b>Explicando as callbacks</b><ul><li>OnElevatorCalled - Quando um elevador й chamado</li>
<li>OnElevatorStoped - Quando um elevador para em algum andar</li>
<li>OnPlayerEnterElevator - Quando um jogador entra em um elevador</li>
<li>OnPlayerIsFrontElevator - Quando um jogador fica na frente de um elevador</li>
<li>OnPlayerLeaveElevator - Quando um jogador sai de um elevador</li>
<li>OnPlayerLeaveFrontElevator - Quando um jogador sai da frente de um elevador</li>
</ul>
No meu exemplo, consegui adicionar 4 elevadores, no mesmo script, utilizando uma ъnica dialog, e as ediзхes ficaram um pouquinho simples. Adicionei me baseando nos elevadores de tais scripts.<br />
<br />
<b>Cуdigo para exemplo do uso do cуdigo (e realizado em meus testes)</b><br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">pawn Code:</div>
