			<title><![CDATA[[Tutorial] Entendendo os sistemas de salvamento (DOF2, dini, ...)]]></title>
			<link>https://sampforum.blast.hk/showthread.php?tid=674591</link>
			<pubDate>Wed, 22 Apr 2020 20:19:00 +0000</pubDate>
			<dc:creator><![CDATA[<a href="https://sampforum.blast.hk/member.php?action=profile&uid=223753">RiqueP</a>]]></dc:creator>
			<guid isPermaLink="false">https://sampforum.blast.hk/showthread.php?tid=674591</guid>
			<description><![CDATA[<font color="DeepSkyBlue"><b>♥ Introdução</b></font><br />
<br />
Como a board está muito cheia de pessoas novas, gostaria de ajudar os novos programadores com alguns artigos que os levem a um bom caminho nessa jornada, ajuda-los com escolhas e principalmente pelo fato dessa board ter poucos tutoriais hoje em dia com práticas mais atuais e maduras. Uma boa parte do conteúdo dessa board é bem antigo e usam métodos não tão bons. Então quero dar um contexto melhor aos sistemas de salvamento atuais, dar uma visão geral e de quebra ditar algumas boas práticas e dicas para ter um código mais performático.<br />
<br />
<font color="DeepSkyBlue"><b>♥ Sobre os sistemas de salvamento</b></font><br />
<br />
<font color="red">* Cada include tem seu próprio sistema e suas otimizações. A explicação aqui dada é uma base de como algumas delas funcionam.</font><br />
<br />
Anteriormente aqui na board, uma boa parte dos devs menos experientes usavam bastante o dini. Desde muito tempo, já existia o DOF2 e outras alternativas até mais rápidas. Hoje em dia a comunidade foi um pouco mais pra frente e utilizam o DOF2, mas até ele já foi ultrapassado no quesito desempenho. Mas não se engane; esse tutorial não veio aqui para ditar qual sistema é mais veloz; na prática, todos eles possuem um desempenho que com toda a certeza vai lhe servir e possuem praticamente os mesmos problemas e vantagens. Mas caso seu foco seja desempenho, e esteja curioso sobre includes mais rápidas que DOF2, tem o bini, dini2 e y_ini.<br />
<br />
Essas includes possuem praticamente a mesma forma de uso, mas quero dar uma visão melhor aqui sobre como elas realmente são. Para entedê-las bem, devemos começar consultando o sistema de arquivos atual do samp (file.inc).<br />
<br />
Quando quero escrever em um arquivo, faço o seguinte:<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP Code:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 66px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB"></span><span style="color: #007700">new </span><span style="color: #0000BB">File</span><span style="color: #007700">:</span><span style="color: #0000BB">arquivo </span><span style="color: #007700">= </span><span style="color: #0000BB">fopen</span><span style="color: #007700">(</span><span style="color: #DD0000">"Arquivo.txt"</span><span style="color: #007700">, </span><span style="color: #0000BB">io_append</span><span style="color: #007700">);
<br/></span><span style="color: #0000BB">fwrite</span><span style="color: #007700">(</span><span style="color: #0000BB">arquivo</span><span style="color: #007700">, </span><span style="color: #DD0000">"bla bla bla\n\r"</span><span style="color: #007700">);
<br/></span><span style="color: #0000BB">fclose</span><span style="color: #007700">(</span><span style="color: #0000BB">arquivo</span><span style="color: #007700">); 
<br/></span><span style="color: #0000BB"></span>
</span>
</code><!-- php buffer end -->
</code>
</div>
</div>Basicamente esse código, ele:<ol style="list-style-type: decimal"><li> Abre o arquivo "Arquivo.txt" (caso não exista, será criado);</li>
<li> Escreve "bla bla bla\n\r" nele;</li>
<li> Fecha o arquivo.</li>
</ol>
Quando quero ler um arquivo, faço o seguinte:<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP Code:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 114px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB"></span><span style="color: #007700">new </span><span style="color: #0000BB">File</span><span style="color: #007700">:</span><span style="color: #0000BB">arquivo </span><span style="color: #007700">= </span><span style="color: #0000BB">fopen</span><span style="color: #007700">(</span><span style="color: #DD0000">"Arquivo.txt"</span><span style="color: #007700">, </span><span style="color: #0000BB">io_append</span><span style="color: #007700">), </span><span style="color: #0000BB">string</span><span style="color: #007700">[</span><span style="color: #0000BB">100</span><span style="color: #007700">];
<br/>while(</span><span style="color: #0000BB">fread</span><span style="color: #007700">(</span><span style="color: #0000BB">arquivo</span><span style="color: #007700">, </span><span style="color: #0000BB">string</span><span style="color: #007700">)) {
<br/>    </span><span style="color: #FF8000">// Valor de string, é o texto da linha atual.
<br/>    </span><span style="color: #007700">print(string);
<br/>}
<br/></span><span style="color: #0000BB">fclose</span><span style="color: #007700">(</span><span style="color: #0000BB">arquivo</span><span style="color: #007700">); 
<br/></span><span style="color: #0000BB"></span>
</span>
</code><!-- php buffer end -->
</code>
</div>
</div>Basicamente esse código, ele:<ol style="list-style-type: decimal"><li> Abre o arquivo "Arquivo.txt";</li>
<li> Lê cada linha do arquivo e printa no console;</li>
<li> Fecha o arquivo.</li>
</ol>
Como pode ver, a um processo de abrir, executar a ação e fechar o arquivo. Quando se trata de leitura, já vai levar mais tempo dependendo de quantas linhas o arquivo tiver. Oque basicamente faz os sistemas de salvamento, é usar uma metodologia de [CHAVE] e [VALOR].<br />
<br />
- [CHAVE]: Seria o campo que você usa para identificar um dado. Por exemplo: "Senha"<br />
- [VALOR]: Seria o que contém o valor dessa chave.<br />
<br />
Vou usar de exemplo uma função como DOF2_GetString. Ela basicamente:<br />
- Abre o arquivo;<br />
- Mapeia todas as chaves e valores e aloca na memoria;<br />
- Lhe retorna o resultado.<br />
<br />
Aqui que começa o ponto interessante. Caso você use DOF2_GetString novamente, e seja o mesmo arquivo, essa funçao será mais rapida do que usada na primeiro vez. Por que? Basicamente, pela segunda etapa. Após aberto o arquivo, ele é mapeado e armazenado na memória. E acessar a memória, é muuuuito mais rapído do que abrir o arquivo, ler, mapear e retornar o resultado. <b>ALGUNS</b> sistemas armazenam mais de um arquivo na memória.<br />
<br />
Agora visualize isso no servidor. Digamos que a include está definida pra manter 10 arquivos em "cache". Um player então entra no servidor, no momento que vai carregar os dados dele, o DOF2_GetString vai mapear os dados dele. Até aqui beleza. Mas ai vai entrando players, e no 11° player, alguem vai perder seus dados em "cache". Então quando você for usar alguma função do DOF2 nesse bem dito, o primeiro DOF2, será mais devagar, mas ai ele será remapeado novamente e alocado novamente; e ai um outro cidadão vai perder seu "cache". Deu pra entender né? Agora imagina isso em um servidor RPG que além do sistema de contas tem: sistema de casa, empresa, veículos e etc usando funções do DOF2. Bom, 10 slots de "cache" para 300 casas, 150 empresas, 30 players, e por ai vai, viu a cagada né?<br />
<br />
Então meu servidor ficará lento? Negativo. Apesar de ser uma operação muito mais pesada se comparado a acessar um valor em memória, os computadores modernos conseguem normalmente executar isso. Mas terá casos em que isso poderá cair em um código que provavelmente irá travar seu servidor. Por exemplo, criar um timer a casa 100ms fazendo loop em todas as casas realizando varias operações de DOF2. Mesmo que seu servidor não fique travado, vai ter mais uso de CPU, independente do código estar mal feito ou não. Claro que dependendo do grau, pode travar seu servidor, mas não quer dizer que qualquer coisa que você fizer vai travar ele, já que o computador executa essas operações extremamente rápido. Mas para aproveitar bem esses sistemas e você ter performance, você deve saber usar bem esses sistemas, e estarei dando a maior dica sobre isso.<br />
<br />
<font color="DeepSkyBlue"><b>♥ Evite operações usando DOF2_...</b></font><br />
Tenha em mente uma coisa, o ideal é você realizar a seguinte sequência: Carregar, Manipular, Salvar. Vou usar de exemplo o sistema de contas que é o mais comum. Seguirá o seguinte padrão:<br />
- Quando o player entrar (OnPlayerConnect), carregue os dados dele para variáveis;<br />
- Enquanto ele estiver no servidor, evite usar DOF2_..., manipule somente as variáveis;<br />
- Quando ele desconectar; de tempos em tempos; e em casos importantes, salve os dados dele.<br />
<br />
Exemplo de código<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP Code:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 498px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB"></span><span style="color: #FF8000">/*
<br/>    Gere uma enum ou variáveis para armazenar os dados do jogador. Aconselho usar enum por ser uma
<br/>    prática melhor e ter um código mais legivel, menos propenso a erros.
<br/>*/
<br/></span><span style="color: #0000BB">enum E_PLAYER_DATA </span><span style="color: #007700">{
<br/>    </span><span style="color: #0000BB">PlayerNome</span><span style="color: #007700">[</span><span style="color: #0000BB">MAX_PLAYER_NAME</span><span style="color: #007700">],
<br/>    </span><span style="color: #0000BB">PlayerSenha</span><span style="color: #007700">[</span><span style="color: #0000BB">20</span><span style="color: #007700">],
<br/>    </span><span style="color: #0000BB">PlayerIp</span><span style="color: #007700">[</span><span style="color: #0000BB">16</span><span style="color: #007700">],

<br/>    </span><span style="color: #0000BB">PlayerDinheiro</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">PlayerLevel
<br/></span><span style="color: #007700">};
<br/>new </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">MAX_PLAYERS</span><span style="color: #007700">][</span><span style="color: #0000BB">E_PLAYER_DATA</span><span style="color: #007700">];

<br/></span><span style="color: #FF8000">/*
<br/>    Carregue os dados dele assim que ele entrar no servidor.
<br/>*/
<br/></span><span style="color: #007700">public </span><span style="color: #0000BB">OnPlayerConnect</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">) {
<br/>    </span><span style="color: #0000BB">GetPlayerName</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerNome</span><span style="color: #007700">], </span><span style="color: #0000BB">MAX_PLAYER_NAME</span><span style="color: #007700">);
<br/>    </span><span style="color: #0000BB">GetPlayerIp</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerIp</span><span style="color: #007700">], </span><span style="color: #0000BB">16</span><span style="color: #007700">);

<br/>    </span><span style="color: #0000BB">format</span><span style="color: #007700">(</span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerSenha</span><span style="color: #007700">], </span><span style="color: #0000BB">20</span><span style="color: #007700">, </span><span style="color: #0000BB">DOF2_GetString</span><span style="color: #007700">(</span><span style="color: #0000BB">PlayerFile</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">), </span><span style="color: #DD0000">"Senha"</span><span style="color: #007700">));

<br/>    </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerDinheiro</span><span style="color: #007700">] = </span><span style="color: #0000BB">DOF2_GetInt</span><span style="color: #007700">(</span><span style="color: #0000BB">PlayerFile</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">), </span><span style="color: #DD0000">"Dinheiro"</span><span style="color: #007700">);
<br/>    </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerLevel</span><span style="color: #007700">] = </span><span style="color: #0000BB">DOF2_GetInt</span><span style="color: #007700">(</span><span style="color: #0000BB">PlayerFile</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">), </span><span style="color: #DD0000">"Level"</span><span style="color: #007700">);
<br/>    return </span><span style="color: #0000BB">1</span><span style="color: #007700">;
<br/>}

<br/></span><span style="color: #FF8000">/*
<br/>    Apartir daqui, os dados estão em variáveis. Use-as.
<br/>*/
<br/></span><span style="color: #007700">public </span><span style="color: #0000BB">OnPlayerSpawn</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">) {
<br/>    </span><span style="color: #0000BB">ResetPlayerMoney</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">);
<br/>    </span><span style="color: #0000BB">GivePlayerMoney</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerDinheiro</span><span style="color: #007700">]);
<br/>    </span><span style="color: #0000BB">SetPlayerScore</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerLevel</span><span style="color: #007700">]);

<br/>    </span><span style="color: #FF8000">// Perceba que os dados estão todos armazenados nas variáveis.
<br/>    </span><span style="color: #007700">return </span><span style="color: #0000BB">1</span><span style="color: #007700">;
<br/>}

<br/></span><span style="color: #FF8000">/*
<br/>    Quando precisar salvar os dados dele na conta, aconselho criar uma função separada para poder
<br/>    salvar os dados com mais facilidade.
<br/>*/
<br/></span><span style="color: #007700">public </span><span style="color: #0000BB">OnPlayerDisconnect</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">reason</span><span style="color: #007700">) {
<br/>    </span><span style="color: #0000BB">PlayerSave</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">);
<br/>    return </span><span style="color: #0000BB">1</span><span style="color: #007700">;
<br/>}

<br/></span><span style="color: #0000BB">PlayerSave</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">) {
<br/>    </span><span style="color: #0000BB">DOF2_SetString</span><span style="color: #007700">(</span><span style="color: #0000BB">PlayerFile</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">), </span><span style="color: #DD0000">"Senha"</span><span style="color: #007700">, </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerSenha</span><span style="color: #007700">]);
<br/>    </span><span style="color: #0000BB">DOF2_SetInt</span><span style="color: #007700">(</span><span style="color: #0000BB">PlayerFile</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">), </span><span style="color: #DD0000">"Dinheiro"</span><span style="color: #007700">, </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerDinheiro</span><span style="color: #007700">]);
<br/>    </span><span style="color: #0000BB">DOF2_SetInt</span><span style="color: #007700">(</span><span style="color: #0000BB">PlayerFile</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">), </span><span style="color: #DD0000">"Level"</span><span style="color: #007700">, </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerLevel</span><span style="color: #007700">]);
<br/>    </span><span style="color: #0000BB">DOF2_SaveFile</span><span style="color: #007700">();
<br/>    return </span><span style="color: #0000BB">1</span><span style="color: #007700">;
<br/>}

<br/></span><span style="color: #FF8000">/*
<br/>    Essa função é apenas para pegar facilmente o arquivo do jogador.
<br/>*/
<br/></span><span style="color: #0000BB">PlayerFile</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">) {
<br/>    new </span><span style="color: #0000BB">file</span><span style="color: #007700">[</span><span style="color: #0000BB">40</span><span style="color: #007700">];
<br/>    </span><span style="color: #0000BB">format</span><span style="color: #007700">(</span><span style="color: #0000BB">file</span><span style="color: #007700">, </span><span style="color: #0000BB">sizeof</span><span style="color: #007700">(</span><span style="color: #0000BB">file</span><span style="color: #007700">), </span><span style="color: #DD0000">"Contas/%s.ini"</span><span style="color: #007700">);
<br/>    return </span><span style="color: #0000BB">file</span><span style="color: #007700">;
<br/>} 
<br/></span><span style="color: #0000BB"></span>
</span>
</code><!-- php buffer end -->
</code>
</div>
</div>Isso pode ser usado também em um sistema de casas por exemplo:<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP Code:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 466px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB"></span><span style="color: #FF8000">/*
<br/>    Gere uma enum ou variáveis para armazenar os dados da casa. Aconselho usar enum por ser uma
<br/>    prática melhor e ter um código mais legivel, menos propenso a erros.
<br/>*/
<br/></span><span style="color: #0000BB">enum E_CASA_DATA </span><span style="color: #007700">{
<br/>    </span><span style="color: #0000BB">CasaDono</span><span style="color: #007700">[</span><span style="color: #0000BB">MAX_PLAYER_NAME</span><span style="color: #007700">],
<br/>    </span><span style="color: #0000BB">CasaID</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">CasaValor</span><span style="color: #007700">,
<br/>};
<br/>new </span><span style="color: #0000BB">Casa</span><span style="color: #007700">[</span><span style="color: #0000BB">MAX_CASAS</span><span style="color: #007700">][</span><span style="color: #0000BB">E_CASA_DATA</span><span style="color: #007700">];

<br/></span><span style="color: #FF8000">/*
<br/>    Carregue os dados da casa assim que o servidor ligar.
<br/>*/
<br/></span><span style="color: #007700">public </span><span style="color: #0000BB">OnGameModeInit</span><span style="color: #007700">() {
<br/>    for(new </span><span style="color: #0000BB">i </span><span style="color: #007700">= </span><span style="color: #0000BB">0</span><span style="color: #007700">; </span><span style="color: #0000BB">i </span><span style="color: #007700">&lt; </span><span style="color: #0000BB">MAX_CASAS</span><span style="color: #007700">; ++</span><span style="color: #0000BB">i</span><span style="color: #007700">) {
<br/>        if(</span><span style="color: #0000BB">DOF2_FileExists</span><span style="color: #007700">(</span><span style="color: #0000BB">CasaFile</span><span style="color: #007700">(</span><span style="color: #0000BB">i</span><span style="color: #007700">))) {
<br/>            </span><span style="color: #0000BB">format</span><span style="color: #007700">(</span><span style="color: #0000BB">Casa</span><span style="color: #007700">[</span><span style="color: #0000BB">i</span><span style="color: #007700">][</span><span style="color: #0000BB">CasaDono</span><span style="color: #007700">], </span><span style="color: #0000BB">MAX_PLAYER_NAME</span><span style="color: #007700">, </span><span style="color: #0000BB">DOF2_GetString</span><span style="color: #007700">(</span><span style="color: #0000BB">CasaFile</span><span style="color: #007700">(</span><span style="color: #0000BB">i</span><span style="color: #007700">), </span><span style="color: #DD0000">"Dono"</span><span style="color: #007700">));
<br/>            </span><span style="color: #0000BB">Casa</span><span style="color: #007700">[</span><span style="color: #0000BB">i</span><span style="color: #007700">][</span><span style="color: #0000BB">CasaID</span><span style="color: #007700">] = </span><span style="color: #0000BB">i</span><span style="color: #007700">;
<br/>            </span><span style="color: #0000BB">Casa</span><span style="color: #007700">[</span><span style="color: #0000BB">i</span><span style="color: #007700">][</span><span style="color: #0000BB">CasaValor</span><span style="color: #007700">] = </span><span style="color: #0000BB">DOF_GetInt</span><span style="color: #007700">(</span><span style="color: #0000BB">CasaFile</span><span style="color: #007700">(</span><span style="color: #0000BB">i</span><span style="color: #007700">), </span><span style="color: #DD0000">"Valor"</span><span style="color: #007700">);
<br/>        }
<br/>    }
<br/>    return </span><span style="color: #0000BB">1</span><span style="color: #007700">;
<br/>}
<br/></span><span style="color: #FF8000">/*
<br/>    Apartir daqui, use as variáveis para pegar e manipular os valores da casa e depois basta salva-lá quando
<br/>    precisar. Aconselho novamente criar uma função de save assim como no sistema de contas.
<br/>*/ 
<br/></span><span style="color: #0000BB"></span>
</span>
</code><!-- php buffer end -->
</code>
</div>
</div>Enfim, sempre evite usar DOF2_ alguma coisa. Mas não se engane, ela não é uma função que será 100% evitada. Haverá casos em que você deverá usa-la diretamente. Alguns dados não da pra ter um pré carregamento, e vai precisar que você use essa função diretamente, e não tem problema nisso. O objetivo desse tutorial não é matar essa função, e sim, lhe explicar o funcionamento de um sistema assim para você saber o melhor momento para usar e não usar.<br />
<br />
<font color="DeepSkyBlue"><b>♥ Última explicação</b></font><br />
<br />
Essa será bem rápida. Quando você faz alguma alteração no arquivo usando DOF2_Set..., ele re-escreve o arquivo totalmente. Isso é devido ao fato do samp não nos disponibilizar uma função para simplesmente re-escrever uma determinada linha.<br />
<br />
<font color="DeepSkyBlue"><b>♥ Notas finais (seguindo o padrão dos meus últimos tutoriais)</b></font><ul><li>
<font color="Red">♪ Escrevi um pouco correndo o tópico mas estarei revisando algumas vezes, conto com o feedback de vocês.</font><br />
♪ Foi uma explicação bem simples, mas procurei ser bem objetivo e claro.<br />
♪ Não procurei escrever de forma muito formal e provavelmente haverá erros de escrita, mas os que forem reportados vou corrigir.<br />
♪ Qualquer dúvida estarei respondendo.<br />
♪ Lembre-se que foram códigos de exemplo, e você deve aperfeiçoa-los quando usa-los.<br />
♪ Estarei escrevendo um outro tutorial sobre os SGBD (SQLite e MySQL) com a mesma temática.</li>
</ul>
<br />
<div align="center"><img alt="" border="0" class="inlineimg" src="images/smilies/clucker2.png" title="Clucker"/></div>]]></description>
			<content:encoded><![CDATA[<font color="DeepSkyBlue"><b>♥ Introdução</b></font><br />
<br />
Como a board está muito cheia de pessoas novas, gostaria de ajudar os novos programadores com alguns artigos que os levem a um bom caminho nessa jornada, ajuda-los com escolhas e principalmente pelo fato dessa board ter poucos tutoriais hoje em dia com práticas mais atuais e maduras. Uma boa parte do conteúdo dessa board é bem antigo e usam métodos não tão bons. Então quero dar um contexto melhor aos sistemas de salvamento atuais, dar uma visão geral e de quebra ditar algumas boas práticas e dicas para ter um código mais performático.<br />
<br />
<font color="DeepSkyBlue"><b>♥ Sobre os sistemas de salvamento</b></font><br />
<br />
<font color="red">* Cada include tem seu próprio sistema e suas otimizações. A explicação aqui dada é uma base de como algumas delas funcionam.</font><br />
<br />
Anteriormente aqui na board, uma boa parte dos devs menos experientes usavam bastante o dini. Desde muito tempo, já existia o DOF2 e outras alternativas até mais rápidas. Hoje em dia a comunidade foi um pouco mais pra frente e utilizam o DOF2, mas até ele já foi ultrapassado no quesito desempenho. Mas não se engane; esse tutorial não veio aqui para ditar qual sistema é mais veloz; na prática, todos eles possuem um desempenho que com toda a certeza vai lhe servir e possuem praticamente os mesmos problemas e vantagens. Mas caso seu foco seja desempenho, e esteja curioso sobre includes mais rápidas que DOF2, tem o bini, dini2 e y_ini.<br />
<br />
Essas includes possuem praticamente a mesma forma de uso, mas quero dar uma visão melhor aqui sobre como elas realmente são. Para entedê-las bem, devemos começar consultando o sistema de arquivos atual do samp (file.inc).<br />
<br />
Quando quero escrever em um arquivo, faço o seguinte:<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP Code:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 66px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB"></span><span style="color: #007700">new </span><span style="color: #0000BB">File</span><span style="color: #007700">:</span><span style="color: #0000BB">arquivo </span><span style="color: #007700">= </span><span style="color: #0000BB">fopen</span><span style="color: #007700">(</span><span style="color: #DD0000">"Arquivo.txt"</span><span style="color: #007700">, </span><span style="color: #0000BB">io_append</span><span style="color: #007700">);
<br/></span><span style="color: #0000BB">fwrite</span><span style="color: #007700">(</span><span style="color: #0000BB">arquivo</span><span style="color: #007700">, </span><span style="color: #DD0000">"bla bla bla\n\r"</span><span style="color: #007700">);
<br/></span><span style="color: #0000BB">fclose</span><span style="color: #007700">(</span><span style="color: #0000BB">arquivo</span><span style="color: #007700">); 
<br/></span><span style="color: #0000BB"></span>
</span>
</code><!-- php buffer end -->
</code>
</div>
</div>Basicamente esse código, ele:<ol style="list-style-type: decimal"><li> Abre o arquivo "Arquivo.txt" (caso não exista, será criado);</li>
<li> Escreve "bla bla bla\n\r" nele;</li>
<li> Fecha o arquivo.</li>
</ol>
Quando quero ler um arquivo, faço o seguinte:<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP Code:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 114px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB"></span><span style="color: #007700">new </span><span style="color: #0000BB">File</span><span style="color: #007700">:</span><span style="color: #0000BB">arquivo </span><span style="color: #007700">= </span><span style="color: #0000BB">fopen</span><span style="color: #007700">(</span><span style="color: #DD0000">"Arquivo.txt"</span><span style="color: #007700">, </span><span style="color: #0000BB">io_append</span><span style="color: #007700">), </span><span style="color: #0000BB">string</span><span style="color: #007700">[</span><span style="color: #0000BB">100</span><span style="color: #007700">];
<br/>while(</span><span style="color: #0000BB">fread</span><span style="color: #007700">(</span><span style="color: #0000BB">arquivo</span><span style="color: #007700">, </span><span style="color: #0000BB">string</span><span style="color: #007700">)) {
<br/>    </span><span style="color: #FF8000">// Valor de string, é o texto da linha atual.
<br/>    </span><span style="color: #007700">print(string);
<br/>}
<br/></span><span style="color: #0000BB">fclose</span><span style="color: #007700">(</span><span style="color: #0000BB">arquivo</span><span style="color: #007700">); 
<br/></span><span style="color: #0000BB"></span>
</span>
</code><!-- php buffer end -->
</code>
</div>
</div>Basicamente esse código, ele:<ol style="list-style-type: decimal"><li> Abre o arquivo "Arquivo.txt";</li>
<li> Lê cada linha do arquivo e printa no console;</li>
<li> Fecha o arquivo.</li>
</ol>
Como pode ver, a um processo de abrir, executar a ação e fechar o arquivo. Quando se trata de leitura, já vai levar mais tempo dependendo de quantas linhas o arquivo tiver. Oque basicamente faz os sistemas de salvamento, é usar uma metodologia de [CHAVE] e [VALOR].<br />
<br />
- [CHAVE]: Seria o campo que você usa para identificar um dado. Por exemplo: "Senha"<br />
- [VALOR]: Seria o que contém o valor dessa chave.<br />
<br />
Vou usar de exemplo uma função como DOF2_GetString. Ela basicamente:<br />
- Abre o arquivo;<br />
- Mapeia todas as chaves e valores e aloca na memoria;<br />
- Lhe retorna o resultado.<br />
<br />
Aqui que começa o ponto interessante. Caso você use DOF2_GetString novamente, e seja o mesmo arquivo, essa funçao será mais rapida do que usada na primeiro vez. Por que? Basicamente, pela segunda etapa. Após aberto o arquivo, ele é mapeado e armazenado na memória. E acessar a memória, é muuuuito mais rapído do que abrir o arquivo, ler, mapear e retornar o resultado. <b>ALGUNS</b> sistemas armazenam mais de um arquivo na memória.<br />
<br />
Agora visualize isso no servidor. Digamos que a include está definida pra manter 10 arquivos em "cache". Um player então entra no servidor, no momento que vai carregar os dados dele, o DOF2_GetString vai mapear os dados dele. Até aqui beleza. Mas ai vai entrando players, e no 11° player, alguem vai perder seus dados em "cache". Então quando você for usar alguma função do DOF2 nesse bem dito, o primeiro DOF2, será mais devagar, mas ai ele será remapeado novamente e alocado novamente; e ai um outro cidadão vai perder seu "cache". Deu pra entender né? Agora imagina isso em um servidor RPG que além do sistema de contas tem: sistema de casa, empresa, veículos e etc usando funções do DOF2. Bom, 10 slots de "cache" para 300 casas, 150 empresas, 30 players, e por ai vai, viu a cagada né?<br />
<br />
Então meu servidor ficará lento? Negativo. Apesar de ser uma operação muito mais pesada se comparado a acessar um valor em memória, os computadores modernos conseguem normalmente executar isso. Mas terá casos em que isso poderá cair em um código que provavelmente irá travar seu servidor. Por exemplo, criar um timer a casa 100ms fazendo loop em todas as casas realizando varias operações de DOF2. Mesmo que seu servidor não fique travado, vai ter mais uso de CPU, independente do código estar mal feito ou não. Claro que dependendo do grau, pode travar seu servidor, mas não quer dizer que qualquer coisa que você fizer vai travar ele, já que o computador executa essas operações extremamente rápido. Mas para aproveitar bem esses sistemas e você ter performance, você deve saber usar bem esses sistemas, e estarei dando a maior dica sobre isso.<br />
<br />
<font color="DeepSkyBlue"><b>♥ Evite operações usando DOF2_...</b></font><br />
Tenha em mente uma coisa, o ideal é você realizar a seguinte sequência: Carregar, Manipular, Salvar. Vou usar de exemplo o sistema de contas que é o mais comum. Seguirá o seguinte padrão:<br />
- Quando o player entrar (OnPlayerConnect), carregue os dados dele para variáveis;<br />
- Enquanto ele estiver no servidor, evite usar DOF2_..., manipule somente as variáveis;<br />
- Quando ele desconectar; de tempos em tempos; e em casos importantes, salve os dados dele.<br />
<br />
Exemplo de código<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP Code:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 498px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB"></span><span style="color: #FF8000">/*
<br/>    Gere uma enum ou variáveis para armazenar os dados do jogador. Aconselho usar enum por ser uma
<br/>    prática melhor e ter um código mais legivel, menos propenso a erros.
<br/>*/
<br/></span><span style="color: #0000BB">enum E_PLAYER_DATA </span><span style="color: #007700">{
<br/>    </span><span style="color: #0000BB">PlayerNome</span><span style="color: #007700">[</span><span style="color: #0000BB">MAX_PLAYER_NAME</span><span style="color: #007700">],
<br/>    </span><span style="color: #0000BB">PlayerSenha</span><span style="color: #007700">[</span><span style="color: #0000BB">20</span><span style="color: #007700">],
<br/>    </span><span style="color: #0000BB">PlayerIp</span><span style="color: #007700">[</span><span style="color: #0000BB">16</span><span style="color: #007700">],

<br/>    </span><span style="color: #0000BB">PlayerDinheiro</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">PlayerLevel
<br/></span><span style="color: #007700">};
<br/>new </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">MAX_PLAYERS</span><span style="color: #007700">][</span><span style="color: #0000BB">E_PLAYER_DATA</span><span style="color: #007700">];

<br/></span><span style="color: #FF8000">/*
<br/>    Carregue os dados dele assim que ele entrar no servidor.
<br/>*/
<br/></span><span style="color: #007700">public </span><span style="color: #0000BB">OnPlayerConnect</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">) {
<br/>    </span><span style="color: #0000BB">GetPlayerName</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerNome</span><span style="color: #007700">], </span><span style="color: #0000BB">MAX_PLAYER_NAME</span><span style="color: #007700">);
<br/>    </span><span style="color: #0000BB">GetPlayerIp</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerIp</span><span style="color: #007700">], </span><span style="color: #0000BB">16</span><span style="color: #007700">);

<br/>    </span><span style="color: #0000BB">format</span><span style="color: #007700">(</span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerSenha</span><span style="color: #007700">], </span><span style="color: #0000BB">20</span><span style="color: #007700">, </span><span style="color: #0000BB">DOF2_GetString</span><span style="color: #007700">(</span><span style="color: #0000BB">PlayerFile</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">), </span><span style="color: #DD0000">"Senha"</span><span style="color: #007700">));

<br/>    </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerDinheiro</span><span style="color: #007700">] = </span><span style="color: #0000BB">DOF2_GetInt</span><span style="color: #007700">(</span><span style="color: #0000BB">PlayerFile</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">), </span><span style="color: #DD0000">"Dinheiro"</span><span style="color: #007700">);
<br/>    </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerLevel</span><span style="color: #007700">] = </span><span style="color: #0000BB">DOF2_GetInt</span><span style="color: #007700">(</span><span style="color: #0000BB">PlayerFile</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">), </span><span style="color: #DD0000">"Level"</span><span style="color: #007700">);
<br/>    return </span><span style="color: #0000BB">1</span><span style="color: #007700">;
<br/>}

<br/></span><span style="color: #FF8000">/*
<br/>    Apartir daqui, os dados estão em variáveis. Use-as.
<br/>*/
<br/></span><span style="color: #007700">public </span><span style="color: #0000BB">OnPlayerSpawn</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">) {
<br/>    </span><span style="color: #0000BB">ResetPlayerMoney</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">);
<br/>    </span><span style="color: #0000BB">GivePlayerMoney</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerDinheiro</span><span style="color: #007700">]);
<br/>    </span><span style="color: #0000BB">SetPlayerScore</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerLevel</span><span style="color: #007700">]);

<br/>    </span><span style="color: #FF8000">// Perceba que os dados estão todos armazenados nas variáveis.
<br/>    </span><span style="color: #007700">return </span><span style="color: #0000BB">1</span><span style="color: #007700">;
<br/>}

<br/></span><span style="color: #FF8000">/*
<br/>    Quando precisar salvar os dados dele na conta, aconselho criar uma função separada para poder
<br/>    salvar os dados com mais facilidade.
<br/>*/
<br/></span><span style="color: #007700">public </span><span style="color: #0000BB">OnPlayerDisconnect</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">, </span><span style="color: #0000BB">reason</span><span style="color: #007700">) {
<br/>    </span><span style="color: #0000BB">PlayerSave</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">);
<br/>    return </span><span style="color: #0000BB">1</span><span style="color: #007700">;
<br/>}

<br/></span><span style="color: #0000BB">PlayerSave</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">) {
<br/>    </span><span style="color: #0000BB">DOF2_SetString</span><span style="color: #007700">(</span><span style="color: #0000BB">PlayerFile</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">), </span><span style="color: #DD0000">"Senha"</span><span style="color: #007700">, </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerSenha</span><span style="color: #007700">]);
<br/>    </span><span style="color: #0000BB">DOF2_SetInt</span><span style="color: #007700">(</span><span style="color: #0000BB">PlayerFile</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">), </span><span style="color: #DD0000">"Dinheiro"</span><span style="color: #007700">, </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerDinheiro</span><span style="color: #007700">]);
<br/>    </span><span style="color: #0000BB">DOF2_SetInt</span><span style="color: #007700">(</span><span style="color: #0000BB">PlayerFile</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">), </span><span style="color: #DD0000">"Level"</span><span style="color: #007700">, </span><span style="color: #0000BB">Player</span><span style="color: #007700">[</span><span style="color: #0000BB">playerid</span><span style="color: #007700">][</span><span style="color: #0000BB">PlayerLevel</span><span style="color: #007700">]);
<br/>    </span><span style="color: #0000BB">DOF2_SaveFile</span><span style="color: #007700">();
<br/>    return </span><span style="color: #0000BB">1</span><span style="color: #007700">;
<br/>}

<br/></span><span style="color: #FF8000">/*
<br/>    Essa função é apenas para pegar facilmente o arquivo do jogador.
<br/>*/
<br/></span><span style="color: #0000BB">PlayerFile</span><span style="color: #007700">(</span><span style="color: #0000BB">playerid</span><span style="color: #007700">) {
<br/>    new </span><span style="color: #0000BB">file</span><span style="color: #007700">[</span><span style="color: #0000BB">40</span><span style="color: #007700">];
<br/>    </span><span style="color: #0000BB">format</span><span style="color: #007700">(</span><span style="color: #0000BB">file</span><span style="color: #007700">, </span><span style="color: #0000BB">sizeof</span><span style="color: #007700">(</span><span style="color: #0000BB">file</span><span style="color: #007700">), </span><span style="color: #DD0000">"Contas/%s.ini"</span><span style="color: #007700">);
<br/>    return </span><span style="color: #0000BB">file</span><span style="color: #007700">;
<br/>} 
<br/></span><span style="color: #0000BB"></span>
</span>
</code><!-- php buffer end -->
</code>
</div>
</div>Isso pode ser usado também em um sistema de casas por exemplo:<br />
<div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">PHP Code:</div>
<div class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 466px;
		text-align: left;
		overflow: auto">
<code style="white-space:nowrap">
<!-- php buffer start --><code><span style="color: #000000">
<span style="color: #0000BB"></span><span style="color: #FF8000">/*
<br/>    Gere uma enum ou variáveis para armazenar os dados da casa. Aconselho usar enum por ser uma
<br/>    prática melhor e ter um código mais legivel, menos propenso a erros.
<br/>*/
<br/></span><span style="color: #0000BB">enum E_CASA_DATA </span><span style="color: #007700">{
<br/>    </span><span style="color: #0000BB">CasaDono</span><span style="color: #007700">[</span><span style="color: #0000BB">MAX_PLAYER_NAME</span><span style="color: #007700">],
<br/>    </span><span style="color: #0000BB">CasaID</span><span style="color: #007700">,
<br/>    </span><span style="color: #0000BB">CasaValor</span><span style="color: #007700">,
<br/>};
<br/>new </span><span style="color: #0000BB">Casa</span><span style="color: #007700">[</span><span style="color: #0000BB">MAX_CASAS</span><span style="color: #007700">][</span><span style="color: #0000BB">E_CASA_DATA</span><span style="color: #007700">];

<br/></span><span style="color: #FF8000">/*
<br/>    Carregue os dados da casa assim que o servidor ligar.
<br/>*/
<br/></span><span style="color: #007700">public </span><span style="color: #0000BB">OnGameModeInit</span><span style="color: #007700">() {
<br/>    for(new </span><span style="color: #0000BB">i </span><span style="color: #007700">= </span><span style="color: #0000BB">0</span><span style="color: #007700">; </span><span style="color: #0000BB">i </span><span style="color: #007700">&lt; </span><span style="color: #0000BB">MAX_CASAS</span><span style="color: #007700">; ++</span><span style="color: #0000BB">i</span><span style="color: #007700">) {
<br/>        if(</span><span style="color: #0000BB">DOF2_FileExists</span><span style="color: #007700">(</span><span style="color: #0000BB">CasaFile</span><span style="color: #007700">(</span><span style="color: #0000BB">i</span><span style="color: #007700">))) {
<br/>            </span><span style="color: #0000BB">format</span><span style="color: #007700">(</span><span style="color: #0000BB">Casa</span><span style="color: #007700">[</span><span style="color: #0000BB">i</span><span style="color: #007700">][</span><span style="color: #0000BB">CasaDono</span><span style="color: #007700">], </span><span style="color: #0000BB">MAX_PLAYER_NAME</span><span style="color: #007700">, </span><span style="color: #0000BB">DOF2_GetString</span><span style="color: #007700">(</span><span style="color: #0000BB">CasaFile</span><span style="color: #007700">(</span><span style="color: #0000BB">i</span><span style="color: #007700">), </span><span style="color: #DD0000">"Dono"</span><span style="color: #007700">));
<br/>            </span><span style="color: #0000BB">Casa</span><span style="color: #007700">[</span><span style="color: #0000BB">i</span><span style="color: #007700">][</span><span style="color: #0000BB">CasaID</span><span style="color: #007700">] = </span><span style="color: #0000BB">i</span><span style="color: #007700">;
<br/>            </span><span style="color: #0000BB">Casa</span><span style="color: #007700">[</span><span style="color: #0000BB">i</span><span style="color: #007700">][</span><span style="color: #0000BB">CasaValor</span><span style="color: #007700">] = </span><span style="color: #0000BB">DOF_GetInt</span><span style="color: #007700">(</span><span style="color: #0000BB">CasaFile</span><span style="color: #007700">(</span><span style="color: #0000BB">i</span><span style="color: #007700">), </span><span style="color: #DD0000">"Valor"</span><span style="color: #007700">);
<br/>        }
<br/>    }
<br/>    return </span><span style="color: #0000BB">1</span><span style="color: #007700">;
<br/>}
<br/></span><span style="color: #FF8000">/*
<br/>    Apartir daqui, use as variáveis para pegar e manipular os valores da casa e depois basta salva-lá quando
<br/>    precisar. Aconselho novamente criar uma função de save assim como no sistema de contas.
<br/>*/ 
<br/></span><span style="color: #0000BB"></span>
</span>
</code><!-- php buffer end -->
</code>
</div>
</div>Enfim, sempre evite usar DOF2_ alguma coisa. Mas não se engane, ela não é uma função que será 100% evitada. Haverá casos em que você deverá usa-la diretamente. Alguns dados não da pra ter um pré carregamento, e vai precisar que você use essa função diretamente, e não tem problema nisso. O objetivo desse tutorial não é matar essa função, e sim, lhe explicar o funcionamento de um sistema assim para você saber o melhor momento para usar e não usar.<br />
<br />
<font color="DeepSkyBlue"><b>♥ Última explicação</b></font><br />
<br />
Essa será bem rápida. Quando você faz alguma alteração no arquivo usando DOF2_Set..., ele re-escreve o arquivo totalmente. Isso é devido ao fato do samp não nos disponibilizar uma função para simplesmente re-escrever uma determinada linha.<br />
<br />
<font color="DeepSkyBlue"><b>♥ Notas finais (seguindo o padrão dos meus últimos tutoriais)</b></font><ul><li>
<font color="Red">♪ Escrevi um pouco correndo o tópico mas estarei revisando algumas vezes, conto com o feedback de vocês.</font><br />
♪ Foi uma explicação bem simples, mas procurei ser bem objetivo e claro.<br />
♪ Não procurei escrever de forma muito formal e provavelmente haverá erros de escrita, mas os que forem reportados vou corrigir.<br />
♪ Qualquer dúvida estarei respondendo.<br />
♪ Lembre-se que foram códigos de exemplo, e você deve aperfeiçoa-los quando usa-los.<br />
♪ Estarei escrevendo um outro tutorial sobre os SGBD (SQLite e MySQL) com a mesma temática.</li>
</ul>
<br />
