			<guid isPermaLink="false">https://sampforum.blast.hk/showthread.php?tid=673922</guid>
			<description><![CDATA[<b><font size="5"><font color="DarkOrchid"><div align="center">Video-Aulas no Youtube</div></font></font></b><br />
<br />
<font color="RoyalBlue"><font size="2"><b>Olб, estou fazendo uma serie de tutoriais onde estarei ensinando um pouco sobre como programar um gm de samp, meus videos sгo para aqueles que estгo ingressando na comunidade e jб tem ao menos um conhecimento de lуgica de programaзгo bбsica mas que nunca tiveram um contato com programaзгo na prбtica ou nгo conhecem nenhuma linguagem de programaзгo, alguns vнdeos tambйm podem vir a ser interessante para aqueles que jб possuem certa experiencia mas ainda nгo dominam completamente ou nгo se sentem confortбveis no ambiente de desenvolvimento para samp. Estes vнdeos tambйm podem ser complementares aos vнdeos do PauloR que estгo disponнveis <a href="https://sampforum.blast.hk/showthread.php?tid=428964" target="_blank"><u>aqui</u></a>.</b></font></font><br />
<br />
<div align="center"><font color="DarkOrchid"><font size="4"><b>Videos:</b></font></font></div><div style="margin:20px; margin-top:5px">
<div class="smallfont" style="margin-bottom:2px">Code:</div>
<pre class="alt2" dir="ltr" style="
		margin: 0px;
		padding: 6px;
		border: 1px solid #C2C2C2;
		width: 800px;
		height: 482px;
		text-align: left;
		overflow: auto"><font size="2"><b><a href="http://www.youtube.com/watch?v=jITcf95XGgA" target="_blank">01. Configurando o ambiente de trabalho (VS Code)</a></b></font>
<font size="2"><b><a href="http://www.youtube.com/watch?v=tNOGOnISuAA" target="_blank">02. Callbacks &amp; Funзхes</a></b></font>
<font size="2"><b><a href="http://www.youtube.com/watch?v=0orOR2sbKvE" target="_blank">03. Comandos</a></b></font>
<font size="2"><b><a href="http://www.youtube.com/watch?v=Wqz2AG23gW0" target="_blank">04. Processadores de comandos (ZCMD)</a></b></font>
<font size="2"><b><a href="http://www.youtube.com/watch?v=b8bGWExTgtU" target="_blank">05. Sistema de arquivos</a></b></font>
